class SimpleChatManager {
   constructor() {
      this.sessionId = null
      this.isPolling = false
      this.lastMessageId = 0
      this.pollInterval = 2000 // 2 seconds
      this.maxRetries = 3
      this.retryCount = 0

      // DOM elements - using your existing structure
      this.chatDialog = document.querySelector('.chat-dialog')
      this.chatInput = document.getElementById('chat-input')
      this.sendButton = document.querySelector('.chat-input-right')
      this.chatContainer = document.querySelector('.chat-container')
      this.chatIcon = document.querySelector('.chat-icon')
      this.chatClose = document.querySelector('.chat-close')


      this.userMessageIds = new Set() // Track user message IDs to prevent duplicates

    //   const currentPath = window.location.pathname
    //   const segments = currentPath.split('/').filter(seg => seg !== '')

    //   const patternsToRemove = [
    //      'billetterie/\\d+/\\d+',  // billetterie/3313/2
    //      'billetterie/\\d+',       // billetterie/3313
    //      'billetterie',            // billetterie
    //      'payment/security',       // payment/security
    //      'payment/pushed',         // payment/pushed
    //      'payment',                // payment
    //      'index\\.php'             // index.php
    //   ]

    //   let cleanPath = currentPath
    //   for (const pattern of patternsToRemove) {
    //      const regex = new RegExp('/' + pattern + '/?$')
    //      if (regex.test(cleanPath)) {
    //         cleanPath = cleanPath.replace(regex, '')
    //         break
    //      }
    //   }

    //   this.apiPath = cleanPath || ''
    //   if (this.apiPath === '/')
     this.apiPath = ''

      this.init()
   }

   init() {
      this.setupChatToggle()
      this.setupEventListeners()
      this.initializeSession()

      window.chatManager = this
   }

   setupChatToggle() {
      // Keep your existing chat toggle functionality
      if (this.chatIcon && this.chatContainer) {
         this.chatIcon.addEventListener('click', () => {
            const isVisible = this.chatContainer.style.opacity === '1'
            this.chatContainer.style.opacity = isVisible ? '0' : '1'
            this.chatContainer.style.pointerEvents = isVisible ? 'none' : 'initial'

            if (!isVisible) {
               const notificationDot = document.querySelector('.notification-dot')
               if (notificationDot) {
                  notificationDot.style.display = 'none'
               }
            }
         })
      }

      if (this.chatClose) {
         this.chatClose.addEventListener('click', () => {
            this.chatContainer.style.opacity = '0'
            this.chatContainer.style.pointerEvents = 'none'
         })
      }
   }

   setupEventListeners() {
      // Send button click
      if (this.sendButton) {
         this.sendButton.addEventListener('click', () => this.sendMessage())
      }

      // Enter key press in textarea
      if (this.chatInput) {
         this.chatInput.addEventListener('keypress', (e) => {
            if (e.key === 'Enter' && !e.shiftKey) {
               e.preventDefault()
               this.sendMessage()
            }
         })

         // Auto-resize textarea (keeping your existing functionality)
         this.chatInput.addEventListener('input', () => {
            this.chatInput.style.height = '1.5em'
            this.chatInput.style.height = Math.min(this.chatInput.scrollHeight, 120) + 'px'
         })
      }
   }

   async initializeSession() {
      console.log(this.apiPath + '/chat/chat-api.php')

      try {
         const response = await fetch(this.apiPath + '/chat/chat-api.php', {
            method : 'POST',
            headers: {
               'Content-Type': 'application/json',
            },
            body   : JSON.stringify({
               action: 'init_session'
            })
         })

         const data = await response.json()

         if (data.status === 'success') {
            this.sessionId = data.session_id
            this.lastMessageId = data.last_message_id || 0
            console.log('✅ Chat session initialized:', this.sessionId)
            this.loadChatHistory()
            this.startPolling()
         } else {
            console.error('❌ Failed to initialize chat session:', data.message)
         }
      } catch (error) {
         console.error('❌ Error initializing chat session:', error)
      }
   }

   async loadChatHistory() {
      try {
         const response = await fetch(this.apiPath + '/chat/chat-api.php', {
            method : 'POST',
            headers: {
               'Content-Type': 'application/json',
            },
            body   : JSON.stringify({
               action    : 'get_history',
               session_id: this.sessionId
            })
         })

         const data = await response.json()

         if (data.status === 'success' && data.messages) {
            // Clear any existing demo messages
            this.chatDialog.innerHTML = ''

            data.messages.forEach(message => {
               this.displayMessage(message, false) // false = don't scroll/notify
               // Track user message IDs to prevent duplicates later
               if (message.sender === 'user') {
                  this.userMessageIds.add(message.id)
               }
            })

            this.scrollToBottom()
         }
      } catch (error) {
         console.error('❌ Error loading chat history:', error)
      }
   }

   async sendMessage() {
      const message = this.chatInput.value.trim()
      if (!message || !this.sessionId) {
         return
      }
      this.addUserMessage(message)

      // Clear input
      this.chatInput.value = ''
      this.chatInput.style.height = '1.5em'

      try {
         const response = await fetch(this.apiPath + '/chat/chat-api.php', {
            method : 'POST',
            headers: {
               'Content-Type': 'application/json',
            },
            body   : JSON.stringify({
               action    : 'send_message',
               session_id: this.sessionId,
               message   : message,
               sender    : 'user'
            })
         })

         const data = await response.json()

         if (data.status === 'success') {
            if (data.message_id) {
               this.userMessageIds.add(data.message_id)
            }

            console.log('✅ Message sent successfully')
            // Let polling handle adding the message to UI
         } else {
            console.error('❌ Failed to send message:', data.message)
            this.showError('Failed to send message')
         }
      } catch (error) {
         console.error('❌ Error sending message:', error)
         this.showError('Connection error')
      }
   }

   startPolling() {
      if (this.isPolling) return

      this.isPolling = true
      this.pollForMessages()
   }

   async pollForMessages() {
      if (!this.isPolling || !this.sessionId) return

      try {
         const response = await fetch(this.apiPath + '/chat/chat-api.php', {
            method : 'POST',
            headers: {
               'Content-Type': 'application/json',
            },
            body   : JSON.stringify({
               action         : 'poll_messages',
               session_id     : this.sessionId,
               last_message_id: this.lastMessageId
            })
         })

         const data = await response.json()

         if (data.status === 'success' && data.messages && data.messages.length > 0) {
            data.messages.forEach(message => {
               // Skip user messages that we already displayed immediately
               if (message.sender === 'user' && this.userMessageIds.has(message.id)) {
                  this.lastMessageId = Math.max(this.lastMessageId, message.id)
                  return
               }

               this.displayMessage(message, true) // true = scroll and notify
               this.lastMessageId = Math.max(this.lastMessageId, message.id)

               // Track user message IDs
               if (message.sender === 'user') {
                  this.userMessageIds.add(message.id)
               }
            })
            this.retryCount = 0 // Reset retry count on success
         }

      } catch (error) {
         console.error('❌ Polling error:', error)
         this.retryCount++

         if (this.retryCount >= this.maxRetries) {
            console.log('⚠️ Max retries reached, stopping polling')
            this.isPolling = false
            return
         }
      }

      // Continue polling
      if (this.isPolling) {
         setTimeout(() => this.pollForMessages(), this.pollInterval)
      }
   }

   displayMessage(message, shouldNotify = true) {
      if (message.sender === 'user') {
         this.addUserMessage(message.message)
      } else if (message.sender === 'support') {
         this.addSupportMessage(message.message, shouldNotify)
      }
   }

   addUserMessage(message) {
      const messageElement = document.createElement('div')
      messageElement.className = 'dialog-item-lox'
      messageElement.innerHTML = `
            <div class="dialog-text">${this.escapeHtml(message)}</div>
        `
      this.chatDialog.appendChild(messageElement)
      this.scrollToBottom()
   }

   addSupportMessage(message, shouldNotify = true) {
      const messageElement = document.createElement('div')
      messageElement.className = 'dialog-item-bot'
      messageElement.innerHTML = `
            <img src="data:image/jpeg;base64," class="support" alt="Support" />
            <div class="dialog-text">${this.escapeHtml(message)}</div>
        `

      this.chatDialog.appendChild(messageElement)
      this.scrollToBottom()

      if (shouldNotify) {
         this.showNotification()
      }
   }

   showError(message) {
      const errorElement = document.createElement('div')
      errorElement.className = 'dialog-item-bot'
      errorElement.innerHTML = `
            <img src="/static/images/support.jpg" class="support" alt="Support" />
            <div class="dialog-text error">❌ ${this.escapeHtml(message)}</div>
        `
      this.chatDialog.appendChild(errorElement)
      this.scrollToBottom()
   }

   showNotification() {
      // Показываем красную точку, если чат не видим
      const isVisible = this.chatContainer && this.chatContainer.style.opacity === '1'

      if (!isVisible) {
         const notificationDot = document.querySelector('.notification-dot')
         if (notificationDot) {
            notificationDot.style.display = 'block'
         }

         this.openChat()
      }
   }

   openChat() {
      if (this.chatContainer) {
         this.chatContainer.style.opacity = '1'
         this.chatContainer.style.pointerEvents = 'initial'
         
         // Скрываем красную точку уведомления
         const notificationDot = document.querySelector('.notification-dot')
         if (notificationDot) {
            notificationDot.style.display = 'none'
         }
      }
   }

   scrollToBottom() {
      setTimeout(() => {
         if (this.chatDialog) {
            this.chatDialog.scrollTop = this.chatDialog.scrollHeight
         }
      }, 100)
   }

   escapeHtml(text) {
      const div = document.createElement('div')
      div.textContent = text
      return div.innerHTML
   }

   stopPolling() {
      this.isPolling = false
   }

   // Public methods for testing
   getStatus() {
      return {
         sessionId    : this.sessionId,
         isPolling    : this.isPolling,
         lastMessageId: this.lastMessageId
      }
   }
}

// Initialize chat when DOM is ready
let simpleChatManager = null

document.addEventListener('DOMContentLoaded', function () {
   // Small delay to ensure all elements are loaded
   setTimeout(() => {
      simpleChatManager = new SimpleChatManager()
      console.log('✅ Simple Chat Manager initialized')
   }, 1000)
})

// Cleanup on page unload
window.addEventListener('beforeunload', function () {
   if (simpleChatManager) {
      simpleChatManager.stopPolling()
   }
})

// Testing functions
window.testSimpleChat = function () {
   if (simpleChatManager) {
      simpleChatManager.chatInput.value = 'Test message from console'
      simpleChatManager.sendMessage()
   } else {
      console.log('❌ Chat not initialized')
   }
}

window.getSimpleChatStatus = function () {
   return simpleChatManager ? simpleChatManager.getStatus() : null
}